import React from 'react'
import ReactDOM from 'react-dom';
let use={
  username:"",
  password:""
};
class Login extends React.Component{
  constructor(){
    this.state={text:""};
  }
  update(e){
    this.setState({text:e.target.value})
    use.username=e.target.value;
  }
  show(){
    alert(use.username);
    alert(use.password)
  }
  render(){
    return(
    <div>
      <lable htmlFor="Username">Username</lable>
      <input className='Username' onKeyUp={this.update.bind(this)}/><br></br>
      <br></br>
      <Password/>
      <br></br>
      <button onClick={this.show.bind(this)}>Submit</button>
    </div>)
  }
}
class Password extends React.Component{
  constructor(){
    this.state={text:''};
  }
  update(e){
    this.setState({text:e.target.value});
    use.password=e.target.value;
  }
  render(){
    return(<>
      <label htmlFor='Password'>Password</label>
      <input className='Password' onkeyUp={this.update.bind(this)}/>
      </>
    )
  }
}
ReactDOM.render(<Login/>,document.getElementById('root'));
